import React, { Component } from "react";

class About extends Component {
  render() {
    return (
      <div>
        <h1>About Page</h1>
        <p>
          My Bread and Butter is Code. I have been a part of the IT industry for
          approximately 4 years and I have gained the expertise and skills to be
          a key IT professional. My knowledge bucket includes variety of skills.
          Working and learning various languages improved my ability to
          understand how most of algorithm works, making easier for me to
          understand new language and new environment.
        </p>
      </div>
    );
  }
}

export default About;
